const serviceEndpoint = 'http://127.0.0.1:5000';

export const addNumber = async (numberToAdd) => {
    const response = await fetch(
      `${serviceEndpoint}/add`,

      {
        method: 'POST',
        headers: new Headers({'content-type': 'application/json'}),
        body: JSON.stringify({
            "number": numberToAdd
        })
      }
    )
    .then((response) => response.json())
}

